import "./IERC20.sol";

contract A  {
    address _contract;


    constructor(address contrato){
        _contract = contrato;

    }
    
    function getSaldo(address _contrato) external view returns(uint256){
      return  IERC20(_contrato).balanceOf(msg.sender);
    }
    
}

